import './App.css';
import FooterComponent from './Component/FooterComponent';
import HeaderComponent from './Component/HeaderComponent';
import LoginForm from './Component/LoginForm';
import SignupForm from './Component/SigupFrom';
import VerifyEmail from './Component/VerifyEmailComponent'; 
import HeaderAdmin from './Admin/HeardeAdmin';

import Home from './Home';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <HeaderComponent />
      <Routes>

         {/* <Route path='/api/v1/' element={<UserComponent />}></Route> */}

          <Route path='/signin' element={<LoginForm />}></Route>
          <Route path='/signup' element={<SignupForm />}></Route>
          <Route path="/verify" element={<VerifyEmail />}></Route>
          <Route path="/" element={<App onLogin={handleLogin} userRole={userRole} />} />
          {userRole === 'ADMIN' && <Route path="/admin" element={<AdminComponent />} />} 
      </Routes>
      <Home />
      <FooterComponent />
      </BrowserRouter>
    </div>
  );
}

export default App;
